import React, {Component} from 'react';





class ProfileCard extends Component {

    render() { 
        return (
            <div className="container-fluid bgProfile">
                <div>
                    <img className='imgJerem ' src={this.props.source}/>
                    <p>Report for</p>
                    <h1>Jeremy Robson</h1>
                </div>
                    
                <div className="bgProfilebas">
                    <p>Daily</p>
                    <p>Weekly</p>
                    <p>Monthly</p>
                </div>
            </div>
        );
    }
}

export default ProfileCard;
